import React from 'react';
import './homePage.css';

const projects = [
  { name: 'Grocery List App', description: 'Manage your groceries easily.' },
  { name: 'Recipe Finder', description: 'Find recipes with available ingredients.' },
  { name: 'Budget Tracker', description: 'Track your grocery expenses.' }
];

function Home() {
  return (
    <div className="home-container">
      <h1>Projects</h1>
      <div className="projects-list">
        {projects.map((project, idx) => (
          <div className="project-card" key={idx}>
            <h2>{project.name}</h2>
            <p>{project.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
